package citi.ctrlStatements;


public class Citi_SwitchCase {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		switch(1){
		    case 1:
			System.out.println("five");
			break;
		    case 2:
			System.out.println("ten");
			break;
		    default:
		    	System.out.println("invalid");
			break;
		}
	}

}
